public V remove(K key) {
  CacheEntry<K,V> cacheEntry = map.remove(key);
  if (cacheEntry != null) {
    stats.size.decrementAndGet();
    if(evictionListener != null) evictionListener.evictedEntry(cacheEntry.key , cacheEntry.value);
    return cacheEntry.value;
  }
  return null;
}

